import React from "react";
import Card from "react-bootstrap/Card";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';
import Tab from 'react-bootstrap/Tab';

const Result = (data) => {
    if (data[0]) {
        return (

            <div>
                <div className="Result-header">
                    <Card style={{ width: '100rem' }}>
                        <Card.Body>
                            <Card.Title>{data[0].place_name}</Card.Title>
                            <Card.Text>{data[0].summary}</Card.Text>
                        </Card.Body>
                    </Card>
                </div>
                <div className="Result-tab">
                    <Tab.Container id="left-tabs-example" defaultActiveKey="first">
                        <Row>
                            <Col sm={3}>
                                <Nav variant="pills" className="flex-column">
                                    <Nav.Item>
                                        <Nav.Link eventKey="first">Any food places nearby?</Nav.Link>
                                    </Nav.Item>
                                    <Nav.Item>
                                        <Nav.Link eventKey="second">Is it safe?</Nav.Link>
                                    </Nav.Item>
                                </Nav>
                            </Col>
                            <Col sm={9}>
                                <Tab.Content>
                                    <Tab.Pane eventKey="first">
                                        {data[0].food_places.map((review) => (
                                            <Card style={{ width: '55rem' }}>
                                                <Card.Body>
                                                    <Card.Title>{review.reviewer}</Card.Title>
                                                    <Card.Text>{review.review_comment}</Card.Text>
                                                </Card.Body>
                                            </Card>
                                        ))}
                                    </Tab.Pane>
                                    <Tab.Pane eventKey="second">
                                        {data[0].is_it_safe.map((review) => (
                                            <Card style={{ width: '55rem' }}>
                                            <Card.Body>
                                                <Card.Title>{review.reviewer}</Card.Title>
                                                <Card.Text>{review.review_comment}</Card.Text>
                                            </Card.Body>
                                        </Card>
                                        ))}
                                    </Tab.Pane>
                                </Tab.Content>
                            </Col>
                        </Row>
                    </Tab.Container>
                </div>
            </div>

        );
    } else {
        return (
            <div />
        );
    }
};

export default Result;
